--
-- View structure for table `public_profiles`
--

DROP VIEW IF EXISTS `public_profiles`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE VIEW `public_profiles` AS
  SELECT
    COALESCE(users.name, celebrities.name) AS name,
    COALESCE(users.gender, celebrities.gender) AS gender,

    HEX(profile_references.public_id) AS public_id,
    profile_references.predefined,
    profile_references.profile_id,

    users.fb_id,
    users.country,
    users.city,

    celebrities.picture,
    celebrities.picture_author,
    celebrities.picture_license,
    celebrities.birthplace,
    celebrities.known_for,

    COALESCE(playlist_users.elo, playlist_celebrities.elo) AS elo,
    COALESCE(playlist_users.wins, playlist_celebrities.wins) AS wins,
    COALESCE(playlist_users.losses, playlist_celebrities.losses) AS losses,
    COALESCE(playlist_users.rank, playlist_celebrities.rank) AS rank,

    playlists.country_short

    FROM profile_references 

    LEFT JOIN users
      ON profile_references.predefined = 0 
      AND users.id = profile_references.profile_id
    LEFT JOIN playlist_users
      ON playlist_users.user_id = users.id

    LEFT JOIN celebrities
      ON profile_references.predefined = 1 
      AND celebrities.id = profile_references.profile_id
    LEFT JOIN playlist_celebrities
      ON playlist_celebrities.celeb_id = celebrities.id

    LEFT JOIN playlists
      ON playlists.id = COALESCE(playlist_users.playlist_id, playlist_celebrities.playlist_id)

  WHERE profile_references.available = 1;
/*!40101 SET character_set_client = @saved_cs_client */;

